import axios from 'axios';

export const refreshToken = async () => {
    try {
        const res = await axios.get('api/renew-token/');
        console.log(res)
    } catch(error) {
        console.log(error)
        SetLogout();
        SetLogoutForLocalSorage();
    }
};
